    const [complexName, setComplexName] = useState('')
    const [street, setStreet] = useState('')
    const [houseNumber, setHouseNumber] = useState('')
    const [houseNumberExtension, setHouseNumberExtension] = useState('')
    const [city, setCity] = useState('')

    const country_ARRAY = [
        {
            value: 'BE',
